import React from 'react'
import TextField from '@material-ui/core/TextField';
import { withRouter } from 'react-router';

function Contact() {
    return (
        <div>
            <form>
                <TextField id="outlined-basic" label="Full Name" variant="outlined" />

            </form>
        </div>
    )
}

export default withRouter(Contact)
